import Header from "./components/Header";
import Footer from "./components/Footer";
import QuizListTable from './components/QuizListTable'; 
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <main>
          <h2>Welcome to the Quiz Application</h2>
          <p>This quiz application built with React.</p>
        </main>
        <QuizListTable />
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
